import React, { useState } from 'react';

const ResultadosEleccion = () => {
  // Estado del componente para almacenar los resultados de la elección
  const [resultados, setResultados] = useState({
    candidatos: [
      { nombre: 'Candidato 1', votos: 100 },
      { nombre: 'Candidato 2', votos: 150 },
      { nombre: 'Candidato 3', votos: 80 },
    ],
  });

  // Función para renderizar la lista de candidatos y sus votos
  const mostrarResultados = () => {
    return resultados.candidatos.map((candidato, index) => (
      <div key={index}>
        <p>{`Candidato: ${candidato.nombre}`}</p>
        <p>{`Votos recibidos: ${candidato.votos}`}</p>
      </div>
    ));
  };

  return (
    <div>
      <h1>Resultados de la Elección</h1>
      {mostrarResultados()}
    </div>
  );
};

export default ResultadosEleccion;
